import React from 'react';

const HardSkills = () => {
	return(		
		<div className="tc">
          <p><strong>Languages:</strong> Spanish and English</p>
          <p><strong>Computer skills:</strong> HTML, CSS, Javascript, Python, NPM, Github, React, SQL, PostgreSQL, Bootstrap, Node.js </p>

    </div> 	   
	);
}

export default HardSkills;
